"""
LeetCode
3440. Reschedule Meetings for Maximum Free Time II
July 2025 Challenge
jramaswami
"""


import collections
from typing import List


Meeting = collections.namedtuple('Meeting', ['start', 'end', 'duration', 'index'])
Gap = collections.namedtuple('Gap', ['duration', 'preceding', 'following'])


class Solution:
    def maxFreeTime(self, eventTime: int, startTime: List[int], endTime: List[int]) -> int:

        def gap_ok(meeting, gap):
            if meeting.index == gap.preceding:
                return False
            if meeting.index == gap.following:
                return False
            return meeting.duration <= gap.duration

        meetings = [Meeting(0, 0, 0, 0)]
        meetings.extend(Meeting(s, e, e-s, i+1) for i, (s, e), in enumerate(zip(startTime, endTime)))
        meetings.append(Meeting(eventTime, eventTime, 0, len(meetings)))
        meetings.sort()
        gaps = [Gap(b.start - a.end, a.index, b.index) for a, b in zip(meetings[:-1], meetings[1:])]
        gaps.sort()
        soln = max(g.duration for g in gaps)

        INF = pow(10,10)
        for meeting in meetings[1:-1]:
            my_gap = meetings[meeting.index+1].start - meetings[meeting.index-1].end
            # Move this meeting left/right
            soln = max(soln, my_gap - meeting.duration)
            # Move to another gap.  We only need to check the three largest
            # gaps to make sure there is another gap we can move this meeting
            # to.  We must exclude the gaps preceding and following this
            # meeting.
            if any(gap_ok(meeting, g) for g in gaps[-3:]):
                soln = max(soln, my_gap)
        return soln


def test_1():
    eventTime = 5
    startTime = [1,3]
    endTime = [2,5]
    expected = 2
    assert Solution().maxFreeTime(eventTime, startTime, endTime) == expected


